import React from 'react';
import { Button, ButtonGroup, Navbar, Nav, Form, FormControl, Container, Row, Col, NavItem, Modal, ListGroupItem } from 'react-bootstrap';
import ListGroup from 'react-bootstrap/ListGroup';



function CarRow(props) {
    return (
        <div className="d-flex w-100 justify-content-between">
            <ListGroup.Item>
                {props.car.model}
            </ListGroup.Item>
        </div>

    )
}




function CarList(props) {
    return <>
        <Col md={10} bg="light" className="collapse d-sm-block below-nav">
            <h2>Auto Noleggiabili</h2>
            <ListGroup as="ul" variant="flush">
                {props.cars.map((car) => <CarRow key={car} car={car} />)}

            </ListGroup>
        </Col>
    </>
}


export default CarList;
